function add(a,b){
    let add = a+b;
    return add;
}

function sub(a,b){
    let sub = a-b;
    return sub;
}
function mult(a,b){
    let mult = a*b;
    return mult;
}
function div(a,b){
    let div = div.tofixed(2);
    return div;
}

export default {add,sub,mult,div};
